import { fetchData } from './fetchAndRead';

const ENDPOINTS = {
    VERMITTLER: '/vermittler',
    EINBRINGER: '/einbringer',
    BETREUER: '/betreuer',
};

class ApiService {
    /**
     * Fetches Vermittler data from the API.
     * @returns {Promise<Array>} - The list of Vermittler.
     */
    static async fetchVermittler() {
        return fetchData(ENDPOINTS.VERMITTLER);
    }

    /**
     * Fetches Einbringer data from the API.
     * @returns {Promise<Array>} - The list of Einbringer.
     */
    static async fetchEinbringer() {
        return fetchData(ENDPOINTS.EINBRINGER);
    }

    /**
     * Fetches Betreuer data from the API.
     * @returns {Promise<Array>} - The list of Betreuer.
     */
    static async fetchBetreuer() {
        return fetchData(ENDPOINTS.BETREUER);
    }
}

export default ApiService;
